import { useState } from "react";

function App() {
  const [cos, setCos] = useState("Wpisz coś: ");
  return (
    <div className="App">
      <h1>
        {cos}
      </h1>
      <input type="text" onChange={(e) => setCos(cos + e.target.value)}/>
    </div>
  );
}

export default App;
